import { useNavigate } from "react-router-dom";

const ProtectedRoutes = ({ components }) => {
    const navigate = useNavigate()
    const lol = true
    if(!lol){
        return navigate("/adminlogin")
    }
  return <>{components}</>;
};

export default ProtectedRoutes;
